# In[15]:


#create the cos matrix for all of 2021
length = len(entries_2021)
entire_2021 = np.zeros((length, length))
row_means =list() 
for i in range(0,length):
    for j in range(i,length):
        mean = 0
        cos = abs(1/(spatial.distance.cosine(vectors_2021[i], vectors_2021[j])-1))
        entire_2021[i][j] = cos
        entire_2021[j][i] = cos 
        mean +=cos
        
        if(cos ==1):
            entire_2021[i][j] = 999
            entire_2021[j][i] = 999
    mean = mean/length
    row_means.append(mean)


# In[16]:


for i in range(0,length):
    for j in range(i,length):
        if  entire_2021[i][j] < row_means[i]:
            entire_2021[i][j] = 0
            entire_2021[j][i] = 0 


# In[18]:


from scipy import sparse
